sys_variable_value.value:
(function parse(inputs, outputs) {

    var item = JSON.parse(inputs.sourceItem);

    outputs.targetObject.year = item["Year"];
    outputs.targetObject.population = item["Population"];
})(inputs, outputs);

(function execute(inputs, outputs) {
// ... code ...
  if (inputs.drilldowns.length > 0) {
    outputs.drilldowns = inputs.drilldowns; 
  } else {
    outputs.drilldowns = "Nation";
  }

  if (inputs.measures.length > 0) {
    outputs.measures = inputs.measures; 
  } else {
    outputs.measures = "Population" 
  }

  gs.info("Output Drilldowns: " + outputs.drilldowns);
  gs.info("Output Measures: " + outputs.measures);
})(inputs, outputs);

